import s from './Friends.module.css'

const Friends = () => {
    return (
        <div className={s.items}>
            <div className={s.item + ' ' + s.active}>
                Arman
            </div>
            <div className={s.item}>
                Nurik
            </div>
            <div className={s.item}>
                Madya
            </div>
            <div className={s.item}>
                Damik
            </div>
            <div className={s.item}>
                Sam
            </div>
        </div>
    );
};

export default Friends;
